  false,\n\t\"url\": null,\n\t\"notes\": \" n        The overall objective of this
  survey is to collect relevant information on water, sanitation and hygiene sectors
  in Praia, hinterlands of Santiago and Sal Islands. Specifically, the survey collects
  information on: The socio-demographic characteristics of the household; determine
  the levels of expenditure and revenues of households ; information on the characteristics
  of water supply systems ; information on the behaviors regarding water storage ;
  data on the treatment of drinking water and disposal of feces ; water borne illnesses
  ; exposure to information on sanitation conveyed by the media ; community participation
  in health-related activities ; property rights ; real estate registration ; land-ownership
  conflicts.n      \",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
